import React, { useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';

function CardInfo() {

    let { id } = useParams();

    const [ card, setCard ] = useState("");

    useEffect(() => {
      axios
        .get(`http://localhost:3003/cards/${id}`)
        .then((response) => {
          setCard(response.data)
        });
    }, []);


  return (
    <div>
      <p>{card.title}</p>
      <p>{card.content}</p>
    </div>
  )
}

export default CardInfo
